import math

def removePrimes(arr):

    def isPrime(num):
        if num < 2:
            return False
        for i in range(2, int(math.sqrt(num)) + 1):
            if num % i == 0:
                return False
        return True
    primes = []
    i = 1
    while i < len(arr):
        if isPrime(arr[i]):
            primes.append(arr[i])
            arr.pop(i)
        else:
            i += 1
    primes.sort()
    for prime in primes:
        print(prime)
    return arr

